import React from 'react'
import Profile from './Profile'
import Post from './Post'
import Suggestion from './Suggestion'

function Main() {
    return (
        <div>
           <div className="main" style={{display:'flex' }}>
           <Profile />
            <Post />
            <Suggestion />
           </div>
        </div>
    );
}

export default Main;
